import { useHistory } from 'react-router-dom';
function Message(props) {

    function odpri(propsi)
    {

        window.location.href = "/message/" + propsi.message._id;
    }

    return (
        <div className="card bg-dark text-dark mb-2">
            <div className="card-img-overlay">
                <h5 className="card-title">{props.message.name}</h5>
            </div>
            <img className="card-img" src={"http://localhost:3001/" + props.message.path} alt={props.message.name}
                onClick={() => odpri(props)} />
        </div>
    )
}
export default Message;
